var tipuesearch = {"pages":[{"title":"About","text":"cmsimde 內容管理系統 倉儲: https://github.com/KEHUEISIN/cd2024 網站: https://KEHUEISIN.github.io/cd2024 簡報: https://KEHUEISIN.github.io/cd2024/reveal 網誌: https://https://KEHUEISIN.github.io/cd2024/blog","tags":"misc","url":"./pages/about/"},{"title":"W8","text":"各週上課內容心得及實作項目 分組個人報告影片 將分組個人所做的分工事情做個人報告影片錄製並放置在分組網頁上。","tags":"w8-41023108","url":"./41023108-w8.html"},{"title":"W7","text":"各週上課內容心得及實作項目 更分組網站內容 指派任務與組員，並要求其查找練習2說明如何在 CoppeliaSim 環境中, 利用 IPv6 ZeroMQ Remote API Python 進行兩個自由度的鋼球平衡檯自動控制系統模擬?相關內容。","tags":"w7-41023108","url":"./41023108-w7.html"},{"title":"W6","text":"各週上課內容心得及實作項目 更分組網站內容 將各組員相關內容放到分組相對應的網頁上，並且指派作業給與組員，因將內容都更在分組網站上，因此這邊內容會減少，","tags":"w6-41023108","url":"./41023108-w6.html"},{"title":"W3","text":"各週上課內容心得及實作項目 將各組員倉儲放到分組網站並建子目錄 method: 第一步:git clone --recurse-submodules git@mdecycu:mdecd2024/2a-midag8.git #需有權限才能抓取到 第二步:直接進入tmp目錄下分組倉儲，後輸入 git submodule add https://github.com/41023110/cd2024.git 41023110 #分組組員個人cd2024倉儲，並以組員倉儲名當作目錄 第三步:git add . git commit -m \"add\" git push 並轉交付任務給與組員","tags":"w3-41023108","url":"./41023108-w3.html"},{"title":"W2","text":"各週上課內容心得及實作項目 組建分組網站內容 更新網站封面連接，並加入各網站分頁，且指派組員完成練習題目。 維護網站 根據影片指示維護網站內容，使用replit/codespaces/近端 如何在近端執行動態網站 首先需有可攜環境才能clone至近端","tags":"w2-41023108","url":"./41023108-w2.html"},{"title":"W1","text":"第一週實作內容報告 w1 建立個人課程倉儲，下載當期可攜環境檔案後將個人倉儲 import 至 Replit，以及設定個人網誌. 2a 建個人課程倉儲 登入個人github帳號，使用老師給的 https://github.com/mdecycu/cmsimde_site 網址倉儲建立名稱為github名稱/cd2024倉儲。 將個人倉儲 import 至 Replit 登入replit，建議以github直接登入可以在後續認證時他會幫你做相關連接查驗。 設定 Github 帳號的雙重認證 進入個人倉儲settings中的ssh and gpg key 項目裡two-factor authentication選項啟動雙重認證，可以綁定手機或手錶，軟體名稱為authy app 有一點別重要，那就是當認證遺失只能以回復碼，才能找回帳號。 如何 import 倉儲至 Replit 進行改版 Replit中設定個人網誌的方法，使用markdown目錄原始檔做複製，可複製Pelican的程式碼，只需將其中的內容改成自己所要發表的內容即可，而Pelican轉換完的網誌內容則會出現在blog目錄下，如要將markdown中.md檔轉入blog中變成.html檔指令為pelican markdown -o blog -s local_publishconf.py，除了這個設定外還有其他別的的方式設定，這就得看使用者的帳號是甚麼在做其他設定。","tags":"w1-41023108","url":"./41023108-w1.html"}]};